    @Test
    public void erroVerdeSeguranca() throws IOException {
        inicioExecucao = new DateTime(2017, 9, 1, 8, 0, 0);

        assertTrue(controlador.isCompleto());

        Motor motor = new Motor(controlador, inicioExecucao, this);
        Pair<Integer, TipoDetector> detector = new Pair<Integer, TipoDetector>(2, TipoDetector.PEDESTRE);

        avancarSegundos(motor, 80);
        motor.onEvento(new EventoMotor(inicioExecucao.plusSeconds(80), TipoEvento.ACIONAMENTO_DETECTOR_PEDESTRE, detector, 3));
        avancarSegundos(motor, 500);

        assertEquals("E2", 2, listaEstagios.get(inicioExecucao.plusSeconds(109)).get(3).getEstagio().getPosicao().intValue());
        verificaGruposSemaforicos(109, new GrupoCheck(3, 8, 0, 2000, EstadoGrupoSemaforico.VERDE));
        verificaGruposSemaforicos(109, new GrupoCheck(3, 8, 2000, 6000, EstadoGrupoSemaforico.AMARELO));
        verificaGruposSemaforicos(109, new GrupoCheck(3, 8, 6000, 7000, EstadoGrupoSemaforico.VERMELHO_LIMPEZA));
        verificaGruposSemaforicos(109, new GrupoCheck(3, 8, 7000, 10000, EstadoGrupoSemaforico.VERMELHO));

        verificaGruposSemaforicos(109, new GrupoCheck(3, 11, 0, 7000, EstadoGrupoSemaforico.VERMELHO));
        verificaGruposSemaforicos(109, new GrupoCheck(3, 11, 7000, 10000, EstadoGrupoSemaforico.VERDE));

        assertEquals("E2", 4, listaEstagios.get(inicioExecucao.plusSeconds(119)).get(3).getEstagio().getPosicao().intValue());

        verificaGruposSemaforicos(119, new GrupoCheck(3, 11, 0, 2000, EstadoGrupoSemaforico.VERDE));
        verificaGruposSemaforicos(119, new GrupoCheck(3, 11, 2000, 11000, EstadoGrupoSemaforico.VERMELHO_INTERMITENTE));
        verificaGruposSemaforicos(119, new GrupoCheck(3, 11, 11000, 12000, EstadoGrupoSemaforico.VERMELHO_LIMPEZA));
        verificaGruposSemaforicos(119, new GrupoCheck(3, 11, 12000, 25000, EstadoGrupoSemaforico.VERMELHO));
    }

